import React from 'react'

import logo from '../images/symptoIcon.jpeg'
import { symptoLogo } from '../icons/icons'

export default function LogoBar() {
    return (
        <div id="logoBar" className="d-flex">
            <img src={logo} alt="SymptoStreet Logo" />
            {symptoLogo}Street
        </div>
    )
}
